import React from "react";
import { useNavigate } from "react-router-dom";
import "./homepage.css";

const Homepage = ({ setLoginUser, isLoggedIn }) => {
  const navigate = useNavigate();

  function handleClick() {
    setLoginUser({});
    navigate("/");
  }

  return (
    <div className="homepage">
      {isLoggedIn ? (
        <>
          <h1>Welcome to the Homepage!</h1>
          <div className="button logout-button" onClick={handleClick}>
            Logout
          </div>
        </>
      ) : (
        <>
          <h1>Login</h1>
          {/* Your login form */}
        </>
      )}
    </div>
  );
};

export default Homepage;
